import React from 'react';

const Contact = () => {
    return (
        <>
        <div className="container-fluid">
            <div className="row">
                <div className="col-10 m-auto">
                    <div className="my-5 text-center"><h1>Contact Us</h1></div>
                </div>
            </div>
        </div>
        </>
    );

}
export default Contact;
